import React from 'react';
import Formulario from '../components/registroParticipantes'
import Aside from '../components/aside';
import Header from '../components/header';
import Footer from '../components/footer';
import Navbar from '../components/navbar';
import { useLocation } from 'react-router-dom';
import RegistrarEquipo from '../components/FormularioRegistrarEquipo'
const RegistroEquipo = () => {
  const location = useLocation();
  const parametro = new URLSearchParams(location.search).get('parametro');

   return (
    <div>
      <Header />
      <div className="main-container" >
        <div className="column1">
          <div className="news-section">
            <Navbar />
          </div>
        </div>
        <div className="column">
          <div className="tweet-composer">
            
            <RegistrarEquipo evento/>
          </div>
        </div>
        <div className="column2">
          <div className="news-section">
            <Aside />
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default RegistroEquipo;
